/*
 * This code can run a lot faster on a wide VLIW.
 * You can try to rewrite the loop and unroll it manually
 * and/or try the compiler unroll pragma
 *
 */

int matrix_mul(){

     int i , j , k;

     for(i = 0; i < M; i++){
         for(j = 0; j < M; j+=2){
//         #pragma unroll 4
             for(k = 0; k < M; k++){
                 c[i][k] += a[i][j] * b[j][k];
                 c[i][k] += a[i][j+1] * b[j+1][k];
             }
         }
     }

     return 0;
 }


int main(void)
{
	int i, j;
	//puts("matrix Test Started");
	matrix_mul();
	
	for (i = 0; i < M; i++)
	{
		for (j = 0; j < M; j++)
		{
			//printf("%d ", c[i][j]);
		
			if (c[i][j] != result[i][j])
			{
				puts("matrix Test Failed\n");
				return 1;
			}
			
		}
		//printf("\n");
	}
	
	puts("matrix Test Passed\n");
	return 0;
}
